// src/pages/HomePage.js (or App.js)

import React from "react";
import UnicornScene from "unicornstudio-react";

export default function HomePage() {
    return (
        <div style={{ position: "relative", width: "100%", height: "100vh", overflow: "hidden" }}>
            {/* UnicornStudio 3D Scene */}
            <UnicornScene
                projectId="WsbdyvD8R71AQIbQn4A9"
                width="100%"
                height="100%"
            />

            {/* UI Layer Over 3D Scene */}
            <div
                style={{
                    position: "absolute",
                    top: 0,
                    left: 0,
                    width: "100%",
                    height: "100%",
                    display: "flex",
                    flexDirection: "column",
                    justifyContent: "center",
                    alignItems: "center",
                    color: "white",
                    zIndex: 10,
                    backdropFilter: "blur(4px)",
                    textAlign: "center",
                }}
            >
                <h1 style={{ fontSize: "3rem", marginBottom: "1rem" }}>Welcome to My App</h1>
                <p style={{ fontSize: "1.2rem", marginBottom: "2rem" }}>
                    Experience the magic of UnicornStudio 3D design!
                </p>
                <div>
                    <button
                        style={{
                            padding: "10px 20px",
                            marginRight: "1rem",
                            fontSize: "1rem",
                            backgroundColor: "#fff",
                            color: "#000",
                            border: "none",
                            borderRadius: "5px",
                            cursor: "pointer",
                        }}
                        onClick={() => alert("Login clicked")}
                    >
                        Login
                    </button>
                    <button
                        style={{
                            padding: "10px 20px",
                            fontSize: "1rem",
                            backgroundColor: "#000",
                            color: "#fff",
                            border: "1px solid #fff",
                            borderRadius: "5px",
                            cursor: "pointer",
                        }}
                        onClick={() => alert("Register clicked")}
                    >
                        Register
                    </button>
                </div>
            </div>
        </div>
    );
}
